VALUES ('8436000465679', 'Brochetas de pavo marinadas', '03.BROCHETAS PAVO MARINADAS.INGREDIENTES: Preparado cárnico. Contramuslo de pavo (78%), pimiento natural (10%) [pimiento verde (7%), pimiento rojo (3%)1, aqua. sal, dextrosa, antioxidantes (ascorbato sodico, Lactato sódico, citratos de sodio), especias, corrector de acide: (acetatos de sodio) y aroma natural. Sin gluten. PUEDE CONTEMER TRAZAS DE SOJR PREPARACIÓN: EN LA SARTEN: con poco aceite, a fuego medio durante 2 min. por cada uno de los cuatro lados. EN LA BARBACOA: untar en aceite y asar a fuego Lento hasta que se dore en la superfície y se ase completamente el interior hasta alcanzar 82°C. Este producto debe cocinarse completamente antes de su consumo. Evitar el contacto con otros alimentos listos para el consumo, paniendo especial cuidado en la limpieza de las manos y utensilios.', 'https://static.openfoodfacts.org/images/products/843/600/046/5679/front_es.4.400.jpg', '1.8', '0.6', '0.5', '0.5', '', '16.4', '1', '0.393700787401575', '', '1');

